package id.co.arya.posq.ui.menunav

import android.app.Activity
import android.app.Dialog
import android.content.Intent
import android.os.Bundle
import android.util.DisplayMetrics
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import android.widget.Toast
import androidx.recyclerview.widget.LinearLayoutManager
import com.google.android.material.bottomsheet.BottomSheetBehavior
import com.google.android.material.bottomsheet.BottomSheetDialog
import com.google.android.material.bottomsheet.BottomSheetDialogFragment
import com.whty.smartpos.tysmartposapi.ITYSmartPosApi
import com.whty.smartpos.tysmartposapi.printer.PrinterConfig
import com.whty.smartpos.tysmartposapi.printer.PrinterConstrants
import com.whty.smartpos.tysmartposapi.printer.PrinterListener
import id.co.arya.posq.R
import id.co.arya.posq.adapter.ItemNavAdapter
import id.co.arya.posq.adapter.onNavSelected
import id.co.arya.posq.local.SharedPreferenceManagerNoHilt
import id.co.arya.posq.ui.login.LoginActivity
import kotlinx.android.synthetic.main.fragment_menu_nav.*

class MenuNavFragment : BottomSheetDialogFragment() {

    lateinit var sharedPreferenceManagerNoHilt: SharedPreferenceManagerNoHilt
    lateinit var smartPosApi: ITYSmartPosApi

    private fun getWindowHeight(): Int { // Calculate window height for fullscreen use
        val displayMetrics = DisplayMetrics()
        (context as Activity?)?.windowManager?.defaultDisplay?.getMetrics(displayMetrics)
        return displayMetrics.heightPixels
    }

    override fun onCreateDialog(savedInstanceState: Bundle?): Dialog {
        return BottomSheetDialog(requireContext(), theme).apply {
            behavior.state = BottomSheetBehavior.STATE_EXPANDED
            behavior.peekHeight = getWindowHeight()
        }
    }

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment

        return inflater.inflate(R.layout.fragment_menu_nav, container, false)
    }

    override fun onActivityCreated(savedInstanceState: Bundle?) {
        super.onActivityCreated(savedInstanceState)
        // getSavedPrinter()
        smartPosApi = ITYSmartPosApi.get(activity)
        smartPosApi.initPrinter()

        setupNavigation()

        close.setOnClickListener {
            dismiss()
        }

        // printer_setting.setOnClickListener {
            // showPrinterList()
        // }

        printer_test.setOnClickListener {
            getSavedPrinter()
        }
    }

    private fun setupNavigation() {
        sharedPreferenceManagerNoHilt = activity?.let { SharedPreferenceManagerNoHilt(it) }!!
        val list = ArrayList<String>()
        list.add("Profile")
        list.add("Transaction")
        list.add("Logout")
        val adapter = ItemNavAdapter(list)
        rv_menu_nav.setHasFixedSize(true)
        rv_menu_nav.layoutManager = LinearLayoutManager(activity)
        rv_menu_nav.adapter = adapter
        adapter.onSelectedNavigation(object : onNavSelected{
            override fun onNavSelected(position: Int, list: ArrayList<String>) {
                when(list[position]) {
                    "Logout" -> {
                        sharedPreferenceManagerNoHilt.clearUserData()
                        val intent = Intent(activity, LoginActivity::class.java)
                        intent.addFlags(Intent.FLAG_ACTIVITY_NEW_TASK or Intent.FLAG_ACTIVITY_CLEAR_TASK)
                        startActivity(intent)
                        activity?.finish()
                    }
                    "Transaction" -> {
                        showToast("List Transaksi")
                    }
                    "Profile" -> {
                        showToast("Profile Merchant")
                    }
                }
            }
        })
    }

    private fun showToast(message: String) {
        Toast.makeText(activity, message, Toast.LENGTH_SHORT).show()
    }

    private fun getSavedPrinter() {
        // Custom Printer Parameter
        val bundle = Bundle()
        bundle.putInt(PrinterConfig.FONT_SIZE, PrinterConstrants.FONT_SIZE_HUGE)
        bundle.putInt(PrinterConfig.ALIGN, PrinterConstrants.ALIGN_CENTER)
        bundle.putInt(PrinterConfig.CN_FONT, PrinterConstrants.KAITI)
        bundle.putInt(PrinterConfig.EN_FONT, PrinterConstrants.AVENAIR)
        smartPosApi.setPrintParameters(bundle)

        smartPosApi.setPrinterListener(object : PrinterListener {
            override fun onPrinterError(p0: String?) {
                showToast("Error Printing")
            }

            override fun onPrinterStart(p0: String?) {
                showToast("Start")
            }

            override fun onPrinterEnd(p0: String?) {
                showToast("Complete")
            }

            override fun onPrinterOutOfPaper() {
                showToast("Out Of Paper")
            }
        })

        smartPosApi.appendScript(
            "!hz n\n" +
                    "!asc n\n" +
                    "!gray 8\n" +
                    "!yspace 6\n" +
                    "!NLFONT hz 0\n" +
                    "!NLFONT asc 0\n" +
                    "*image c 100*100 data:base64;\n" +
                    "!yspace 6\n" +
                    "*text l NAMA MERCHANT\n" +
                    "*text l ALAMAT MERCHANT\n" +
                    "*text c ................................\n" +
                    "*text l No Pesanan              12345678\n" +
                    "*text l Kode                    12345678\n" +
                    "*text l Tanggal               10 12 2021\n" +
                    "*text l Waktu                      20:00\n" +
                    "*text c ................................\n" +
                    "*text l ESTEH MANIS                     \n" +
                    "*text l x2          12.000        24.000\n" +
                    "*text l ESTEH MANIS                     \n" +
                    "*text l x2          12.000        24.000\n" +
                    "*text l ESTEH MANIS                     \n" +
                    "*text l x2          12.000        24.000\n" +
                    "*text c ................................\n" +
                    "*text l TOTAL                     720.000\n" +
                    "*text c ................................\n" +
                    "*text c ................................\n" +
                    "*text c ................................\n" +
                    "*text c ................................\n"
        );
        smartPosApi.startPrint()
    }

}